import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { ConfiguracionesRoutingModule } from './configuraciones-routing.module';
import { DatosDeLaEmpresaComponent } from './datos-de-la-empresa/datos-de-la-empresa.component';
import { ActualizarCuentaComponent } from './actualizar-cuenta/actualizar-cuenta.component';
import { ReactiveFormsModule } from '@angular/forms';


@NgModule({
  declarations: [
    DatosDeLaEmpresaComponent,
    ActualizarCuentaComponent
  ],
  imports: [
    CommonModule,
    ConfiguracionesRoutingModule,
    ReactiveFormsModule
  ]
})
export class ConfiguracionesModule { }
